import React from 'react'
import Cart from './Cart';
import Hompage from './Hompage';
import Product from './Product';
function E_Cart() {
    return (
        <div>
            <Cart></Cart>
            <Hompage></Hompage>
            <Product></Product>
        </div>
    )
}
export default E_Cart
